import React from "react";
import { Box } from "@mui/material";
import "./style/mainContainer.css";

function MainContainer() {
  return (
    <div>
      <Box className="container">
        <div className="left-box">
          <h1>HI</h1>
        </div>
        <div className="right-box">
          <h1>HI</h1>
        </div>
      </Box>
    </div>
  );
}

export default MainContainer;
